import {motion, useTransform, useScroll} from 'framer-motion';
import {useRef} from 'react';

function useParallax(value, distance) {
    return useTransform(value, [0, 1], [-distance, distance]);
  }

const Content = () => {
    // const work = useRef(null);
    // const {scrollYProgress} = useScroll({taget: work});
    // const y = useParallax(scrollYProgress, 300);

    const work = useRef(null);
    const { scrollYProgress } = useScroll({ target: work });
    const y = useParallax(scrollYProgress, 300);
    return (
        <section id="academics" className='relative border-2 h-[100vh] snap-center flex flex-col justify-between items-center'>
            <div className='border-2 w-full h-[25%] flex flex-row justify-center text-center overflow-scroll bg-red-800'>
                <>
                    <div className='w-[49%] h-full border flex flex-col justify-center items-center text-right pt-2'>
                        <span className='w-full '>August 2022 - Present</span>
                    </div>
                    <div className='w-[10%] h-fit flex flex-col '>
                        <span className='w-full border-b-0'></span>
                        <span className='w-full '></span>
                    </div>
                    <div className=' w-[5%] h-full border flex flex-col items-center text-center'>
                        <span className='w-[0%] border h-full'></span>
                        <span className='w-full border rounded-full p-2 '><i className='fa fa-graduation-cap'></i></span>
                        <span className='w-[0%] border h-full'></span>
                    </div>
                    <div className='w-[10%] h-fit flex flex-col '>
                        <span className='w-full border-b-0'></span>
                        <span className='w-full '></span>
                    </div>
                    <div className='w-[49%] h-full border flex flex-col justify-center rounded-lg text-left px-4'>
                        <span>Binghamton University</span>
                        <span>Master's in Computer Science</span>
                    </div>
                </>
                <div className='w-full border'></div>
            </div>
            {/* 2nd div */}
            <div className='border-2 relative w-full h-[25%] flex flex-row justify-center text-center overflow-scroll py-0'>
                <div className='w-[49%] h-full border flex flex-col justify-center rounded-lg text-right px-4 bg-blue-900'>
                    <span>Binghamton University</span>
                    <span>Master's in Computer Science</span>
                </div>
                <div className='w-[10%] h-full border flex flex-col '>
                    <span className='w-full border-b-0'></span>
                    <span className='w-full '></span>
                </div>
                <div className='w-[5%] h-full border flex flex-col items-center text-center'>
                    <span className='w-[0%] border h-full'></span>
                    <span className='w-full border rounded-full p-2 '><i className='fa fa-graduation-cap'></i></span>
                    <span className='w-[0%] border h-full'></span>
                </div>
                <div className='w-[10%] h-full border flex flex-col '>
                    <span className='w-full border-b-0'></span>
                    <span className='w-full '></span>
                </div>
                <div className='w-[49%] h-full border flex flex-col justify-center items-center text-left pt-2'>
                    <span className='w-full '>August 2022 - Present</span>
                </div>
            </div>

        </section>
    )
}

const Workex = () => {
    return (
        <Content />
    )
}

export default Workex;




